/*Table structure for table `t_case_lib` */

DROP TABLE IF EXISTS `t_case_lib`;

CREATE TABLE `t_case_lib` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `lib_no` int(11) DEFAULT NULL COMMENT '病例库编号',
  `user_id` varchar(64) DEFAULT NULL COMMENT '归属用户',
  `office_id` varchar(64) DEFAULT NULL COMMENT '归属机构',
  `area_id` varchar(64) DEFAULT NULL COMMENT '归属区域',
  `case_id` varchar(64) DEFAULT NULL COMMENT '病例',
  `gender` char(1) DEFAULT NULL COMMENT '性别',
  `aget` varchar(5) DEFAULT NULL COMMENT '年龄',
  `age_unit` varchar(11) DEFAULT NULL COMMENT '年龄单位',
  `cli_diag` varchar(2000) DEFAULT NULL COMMENT '临床诊断',
  `cli_mas` varchar(2000) DEFAULT NULL COMMENT '临床主述',
  `ope_find` varchar(2000) DEFAULT NULL COMMENT '手术部位',
  `bio_org` varchar(2000) DEFAULT NULL COMMENT '活检巨检部位',
  `dia` varchar(2000) DEFAULT NULL COMMENT '诊断意见',
  `lib_create_type` varchar(10) DEFAULT NULL COMMENT '病例库创建方式',
  `lib_state` varchar(4) DEFAULT NULL COMMENT '病例库状态',
  `pat_type_id` varchar(64) DEFAULT NULL COMMENT '病例库类型',
  `icd_no` varchar(64) DEFAULT NULL COMMENT '病例库ICD编码',
  `tag` varchar(100) DEFAULT NULL COMMENT '病例库标签',
  `lib_submit_by` varchar(64) DEFAULT NULL COMMENT '病例库提交者',
  `lib_submit_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '病例库提交时间',
  `lib_audit_by` varchar(64) DEFAULT NULL COMMENT '病例库审核者',
  `lib_audit_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '病例库审核时间',
  `src_app` varchar(10) DEFAULT NULL COMMENT '来源APP',
  `src_env` varchar(10) DEFAULT NULL COMMENT '来源APP环境',
  `src_app_version` varchar(15) DEFAULT NULL COMMENT '来源App版本',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  `history` varchar(2000) DEFAULT NULL COMMENT '简要病史',
  `hospital` varchar(100) DEFAULT NULL COMMENT '医院',
  `cli_data` varchar(500) DEFAULT NULL COMMENT '临床资料',
  `gen_desc` varchar(500) DEFAULT NULL COMMENT '大体描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='病例库-病例';

/*Data for the table `t_case_lib` */

insert  into `t_case_lib`(`id`,`lib_no`,`user_id`,`office_id`,`area_id`,`case_id`,`gender`,`aget`,`age_unit`,`cli_diag`,`cli_mas`,`ope_find`,`bio_org`,`dia`,`lib_create_type`,`lib_state`,`pat_type_id`,`icd_no`,`tag`,`lib_submit_by`,`lib_submit_date`,`lib_audit_by`,`lib_audit_date`,`src_app`,`src_env`,`src_app_version`,`create_by`,`create_date`,`update_by`,`update_date`,`remarks`,`del_flag`,`history`,`hospital`,`cli_data`,`gen_desc`) values ('1',1,'1','1','1','205478','m','60','岁','胃与膈肌',NULL,'胃与膈肌',NULL,NULL,NULL,NULL,'13',NULL,NULL,NULL,'2016-07-29 15:29:32',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,'1','0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者男，60岁，1个月前无明显诱因上腹部不适。','北京肿瘤医院','患者1个月前无明显诱因上腹部不适，外院行CT检查提示：脾周占位明显不均匀强化，软组织影，边缘光滑，最大截面6.6×5.3cm，局部凸向膈頂。否认肝炎史、结核史、高血压史、心脏病史。于我院行腹腔镜辅助胃肿物切除，胃部分切除，膈肌部分切除术','大体检查：肿物一枚，大小7.5×7×5.5cm，肿物表面附部分胃壁，面积7×6cm，另见部分膈肌大小6×4.5cm，肿物切面灰黄灰红、实性、质中，肉眼累及胃壁，侵及膈肌。'),('10',1,'1','1','1','143903','f','52','岁','子宫',NULL,'子宫',NULL,NULL,NULL,NULL,'6',NULL,NULL,NULL,'2016-07-29 15:29:31',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者女，52岁，阴道不规则流血半年。','九江市第三人民医院','患者阴道不规则流血半年。','大体：宫内膜面见4*2*1厘米息肉样突起肿物，切面灰白、实性、质少软，可见部分区坏死。'),('11',1,'1','1','1','143803','f','2','岁','右肾',NULL,'右肾',NULL,NULL,NULL,NULL,'2',NULL,NULL,NULL,'2016-07-29 15:29:23',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者女，2岁，血尿一天。','九江市妇幼保健院','患者血尿一天，伴有血凝块，彩超提示右肾实性占位。',''),('12',1,'1','1','1','143103','m','65','岁','膀胱厚壁',NULL,'膀胱厚壁',NULL,NULL,NULL,NULL,'3',NULL,NULL,NULL,'2016-07-29 15:29:25',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者男，65岁，排尿不适，夜尿增多反复发作6年余。','九江市中医院','患者排尿不适，夜尿增多反复发作6年余，再发加重10天，CT示：膀胱厚壁占位（性质待定），前列腺增生。','术中见膀胱后壁大小约3*2厘米包块。'),('2',1,'1','1','1','148603','m','54','岁','腹膜后',NULL,'腹膜后',NULL,NULL,NULL,NULL,'7',NULL,NULL,NULL,'2016-07-29 15:29:26',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者男，54岁，主因“检查发现左腹膜后肿物7年”入院治疗。','北京肿瘤医院','患者检查发现左腹膜后肿物7年入院就诊，7年前因“左睾丸癌根治术后”行腹部CT复查发现左侧腹膜后占位，直径约3.0cm，不除外转移，未行处理。2年前腹部CT提示腹膜后占位体积增大，直径约7.0cm。同时伴有左侧颈部结节，大小约3.0cm。2月前患者因突发左下腹剧痛，伴发左侧腰背部、左下肢上部放射性疼痛，于当地医院行腹腔镜下腹膜后肿物切除术，术后腹痛等症状较前明显好转。术后病理提示（腹膜后）送检组织大部分坏死，部分为纤维结缔组织性囊壁伴炎细胞及肉芽肿形成，部分可见血管瘤样结构，小灶囊壁衬覆少许分化良好的高柱状上皮。1月前患者再次突发下腹痛，性质剧烈，伴发左侧腰背部、左下肢上部放射性疼痛。伴有排气、排便障碍，腹胀明显，偶发恶心。无尿频、尿急、肉眼血尿等。于我院行行肿物联合胰体尾+脾+左肾+左半结肠切除术。','大体检查：肿物大小40×22×6cm，书页状切开，切面灰黄灰褐实性质硬，表面可见粘液，肿物累及肾脏、肾上腺、结肠周脂肪组织，未累及脾脏及胰腺。'),('3',1,'1','1','1','148503','f','55','岁','右主韧带',NULL,'右主韧带',NULL,NULL,NULL,NULL,'7',NULL,NULL,NULL,'2016-07-29 15:29:26',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者女，55岁，主因“间断性阴道出血2年半，发现左锁骨上肿块2月余”入院治疗。','北京肿瘤医院','患者主因“间断性阴道出血2年半，发现左锁骨上肿块2月余”入院治疗。我院2015-11-3超声：左颈部至锁骨上多发肿大淋巴结，左附件区占位，性质待定，右侧骼血管旁多发淋巴结，倾向转移。盆腹CT：左附件区囊实性占位，48*58mrn，右附件区饱满。于我院行全子宫及双附件切除术。','大体检查：子宫大小9×6.5×3cm，临床已沿前壁打开子宫，宫腔深4.5cm，寓颈管长 3cm，宫颈外口直径3cm，前壁肌层厚2.8cm，于宫腔内见一隆起型肿物，大小3.5×2cm，高出内膜0.3cm，切面灰白实性质硬，肉眼累及浅肌层，肿物侵及肌层最厚处约1cm，该处肌壁厚2.8cm，近右侧宫角处浆膜处见一灰白结节，最大径0.8cm，灰白实性质硬。（右附件）输卵管长5crn，直径1.2 cm，伞可见；卵巢大小3×2×lcm，表面尚光滑，切面朱见特殊。（左附件）输卵管长5cm，直径lcm，伞可见；卵巢已 大部分为肿物取代，肿物大小10×8×7cm，附完整包膜，临床已切开，切面灰黄灰白实性质地中等，局灶囊性变。'),('4',1,'1','1','1','148403','f','55','岁','宫腔',NULL,'宫腔',NULL,NULL,NULL,NULL,'7',NULL,NULL,NULL,'2016-07-29 15:29:27',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者女性，55岁，主因“间断性阴道出血2年半，发现左锁骨上肿块2月余”入院治疗。','北京肿瘤医院','患者女性，55岁，主因“间断性阴道出血2年半，发现左锁骨上肿块2月余”入院治疗。我院2015-11-3超声：左颈部至锁骨上多发肿大淋巴结，左附件区占位，性质待定，右侧骼血管旁多发淋巴结，倾向转移。盆腹CT：左附件区囊实性占位，48*58mm，右附件区饱满。于我院行全子宫及双附件切除术。','大体检查：子宫大小9×6.5×3cm，临床已沿前壁打开子宫，宫腔深4.5cm，寓颈管长 3cm，宫颈外口直径3cm，前壁肌层厚2.8cm，于宫腔内见一隆起型肿物，大小3.5×2cm，高出内膜0.3cm，切面灰白实性质硬，肉眼累及浅肌层，肿物侵及肌层最厚处约1cm，该处肌壁厚2.8cm，近右侧宫角处浆膜处见一灰白结节，最大径0.8cm，灰白实性质硬。（右附件）输卵管长5crn，直径1.2 cm，伞可见；卵巢大小3×2×lcm，表面尚光滑，切面朱见特殊。（左附件）输卵管长5cm，直径lcm，伞可见；卵巢已大部分为肿物取代，肿物大小10×8×7cm，附完整包膜，临床已切开，切面灰黄灰白实性质地中等，局灶囊性变。'),('5',1,'1','1','1','146903','m','65','岁','左叶甲状腺',NULL,'左叶甲状腺',NULL,NULL,NULL,NULL,'99',NULL,NULL,NULL,'2016-07-29 15:29:27',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者男，65岁，体检时发现左叶甲状腺肿物，大小约2.0*2.0cm，近日肿瘤逐渐增大，伴有压痛。','解放军307医院','患者体检发现左叶甲状腺肿物，大小约2.0*2.0cm，近1个月肿瘤逐渐增大至6.0*7.0cm，伴有压痛。甲状腺超声：左侧甲状腺多发囊实性结节，部分呈融合状，最大范围6.0*5.1cm。颈部CT：甲状腺左叶旁囊实性占位，考虑甲状腺来源可能性大。患者2013年行升结肠癌根治切除术，2015年7月15日行结肠癌肝转移灶射频消融术。','（左叶甲状腺）灰红灰白色肿物1个，大小约8.5*5.5*4.5cm，部分区可见包膜，部分区已破裂，质糟脆，切面部分灰白色，实性，质稍韧，部分区灰红色，实性质中，边缘见少许甲状腺组织，另送淋巴结多枚。'),('6',1,'1','1','1','146803','f','42','岁','小肠',NULL,'小肠',NULL,NULL,NULL,NULL,'10',NULL,NULL,NULL,'2016-07-29 15:29:28',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者女，42岁，2014年7月23日腹部CT检查提示：腹腔内偏右侧缘于小肠的占位，并侵及周围肠管。','解放军307医院','患者于2012年底出现黑便、便中带血，无粘液便、里急后重等症状，未行治疗。2013年患者无意发现右下腹包块，大小5.0*8.0cm，边界不清，无触痛。2014年7月23日淮北市人民医院行腹部CT检查提示：腹腔内偏右侧缘于小肠的占位，并侵及周围肠管。7月30日行“小肠肿瘤切除术”。既往2012年12月行“右侧甲状腺乳头状癌切除术”。','术中见：小肠肿瘤约12.0*10.0cm，距屈氏韧带约6.0cm，切除肿瘤段控场约40cm处。肝、脾、胰腺、胃未见异常。'),('7',1,'1','1','1','146703','m','36','岁','左侧输尿管外侧',NULL,'左侧输尿管外侧',NULL,NULL,NULL,NULL,'4',NULL,NULL,NULL,'2016-07-29 15:29:28',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者男，36岁，主因“无痛性肉眼血尿10月余”入院就诊。','解放军307医院','患者无痛性肉眼血尿10月余，于当地医院行膀胱镜提示：膀胱肿物，左侧输尿管结石。','（左输尿管口外侧肿物）灰白色不整形组织一块，直径0.4cm，全包。'),('8',1,'1','1','1','144103','f','49','岁','左乳',NULL,'左乳',NULL,NULL,NULL,NULL,'7',NULL,NULL,NULL,'2016-07-29 15:29:29',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者女，49岁，发现左乳肿块10天。','九江市附属医院','患者左乳肿块10天，左乳内上距乳头1.5厘米处可见9*8厘米范围红肿。B超示左乳内象限见大片状无回声区，内见较密光点，边缘模糊。临床拟左乳脓肿收入院。','大体：6*5*2厘米灰白灰红色碎组织一堆，取6块。'),('9',1,'1','1','1','144003','f','77','岁','右侧颈部甲状腺',NULL,'右侧颈部甲状腺',NULL,NULL,NULL,NULL,'99',NULL,NULL,NULL,'2016-07-29 15:29:30',NULL,'0000-00-00 00:00:00',NULL,NULL,NULL,NULL,'0000-00-00 00:00:00',NULL,'0000-00-00 00:00:00',NULL,'0','患者女，77岁，右侧颈部卵圆形包块15天。','永修县人民医院','患者右侧颈部卵圆形包块15天，无疼痛，无吞咽困难，无发热，无消瘦，既往无其他部位肿瘤等病史。B超显示：右侧甲状腺实质性占位。CT显示：右侧甲状腺占位。','巨检：甲状腺组织一个，大小8.5cm*8cm*3.5cm。切面实性，可见多个灰白色结节，质地较硬，无出血、坏死。');

/*Table structure for table `t_case_lib_comment` */

DROP TABLE IF EXISTS `t_case_lib_comment`;

CREATE TABLE `t_case_lib_comment` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `lib_case_id` varchar(64) DEFAULT NULL COMMENT '病例',
  `content` varchar(4000) DEFAULT NULL COMMENT '内容',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='病例库-点评';

