/*Table structure for table `t_case_lib_slide` */

DROP TABLE IF EXISTS `t_case_lib_slide`;

CREATE TABLE `t_case_lib_slide` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `case_lib_id` varchar(64) DEFAULT NULL COMMENT '病例库',
  `barcode` varchar(100) DEFAULT NULL COMMENT '条码',
  `antitbody_name` varchar(200) DEFAULT NULL COMMENT '抗体名称',
  `antibody_code` varchar(40) DEFAULT NULL COMMENT '抗体代码',
  `antibody_seq` char(10) DEFAULT NULL COMMENT '抗体序号',
  `label` longtext COMMENT '标签图',
  `overview` longtext COMMENT '缩略图',
  `label_with_overview` longtext COMMENT '标签&缩略图',
  `url` varchar(500) DEFAULT NULL COMMENT '书签切片URL',
  `scanner` varchar(20) DEFAULT NULL COMMENT '扫描仪类型',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  `read_film_id` varchar(64) DEFAULT NULL COMMENT '读片会id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

