/*Table structure for table `t_cst_case` */

DROP TABLE IF EXISTS `t_cst_case`;

CREATE TABLE `t_cst_case` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `case_id` varchar(64) DEFAULT NULL COMMENT '病例',
  `test_no` varchar(30) DEFAULT NULL COMMENT '实验号',
  `company` varchar(64) DEFAULT NULL COMMENT '子公司',
  `lab` varchar(30) DEFAULT NULL COMMENT '实验室',
  `user_id` varchar(64) DEFAULT NULL COMMENT '归属用户',
  `office_id` varchar(64) DEFAULT NULL COMMENT '归属机构',
  `area_id` varchar(64) DEFAULT NULL COMMENT '归属区域',
  `request_id` varchar(64) DEFAULT NULL COMMENT '标本id',
  `kmbarcode` varchar(30) DEFAULT NULL COMMENT '标本条码',
  `name` varchar(200) DEFAULT NULL COMMENT '姓名',
  `gender` char(1) DEFAULT NULL COMMENT '性别',
  `age` varchar(5) DEFAULT NULL COMMENT '年龄',
  `age_unit` int(11) DEFAULT NULL COMMENT '年龄单位',
  `cli_dia` varchar(2000) DEFAULT NULL COMMENT '临床诊断',
  `cli_mas` varchar(2000) DEFAULT NULL COMMENT '临床主述',
  `fam_his` varchar(2000) DEFAULT NULL COMMENT '家族史',
  `oth_his` varchar(2000) DEFAULT NULL COMMENT '其它病史',
  `oth_sup` varchar(2000) DEFAULT NULL COMMENT '其它辅助检查',
  `ope_org` varchar(1000) DEFAULT NULL COMMENT '手术部位',
  `bio_org` varchar(1000) DEFAULT NULL COMMENT '活检巨检部位',
  `ope_find` varchar(2000) DEFAULT NULL COMMENT '手术所见',
  `pri_pat_dia` varchar(2000) DEFAULT NULL COMMENT '初诊意见',
  `cst_pat_exp` varchar(200) DEFAULT NULL COMMENT '会诊者',
  `state` varchar(4) DEFAULT NULL COMMENT '会诊状态 0 新会诊 1 已诊断（已发送，其他状态为未发送） 2 已查看 3申请加做中 4 已保存草稿 5 加做项目返回',
  `test_code` varchar(50) DEFAULT NULL COMMENT '检查项目',
  `cst_dia` varchar(2000) DEFAULT NULL COMMENT '诊断意见',
  `src_app` varchar(10) DEFAULT NULL COMMENT '来源APP',
  `src_env` varchar(10) DEFAULT NULL COMMENT '来源APP环境',
  `src_app_version` varchar(15) DEFAULT NULL COMMENT '来源App版本',
  `apply_date` timestamp NULL DEFAULT NULL COMMENT '申请时间',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  `send_path` mediumtext COMMENT '发送报告单路径',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会诊-病例';

