/*Table structure for table `t_cst_sup_antibody` */

DROP TABLE IF EXISTS `t_cst_sup_antibody`;

CREATE TABLE `t_cst_sup_antibody` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `case_id` varchar(64) DEFAULT NULL COMMENT '病例',
  `antibody_code` varchar(50) DEFAULT NULL COMMENT '抗体代码',
  `antibody_name` varchar(200) DEFAULT NULL COMMENT '抗体名称',
  `status` varchar(4) DEFAULT NULL COMMENT '加做状态',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会诊-加做项目';

/*Data for the table `t_cst_sup_antibody` */

