insert  into `t_read_film`(`id`,`name`,`address`,`dates`,`org_name`,`remarks`,`create_by`,`create_date`,`update_by`,`update_date`,`del_flag`) values ('1','北京市第501次','东单三条甲7号（中华医学会北京分会二楼）','2016-07-26 15:18:11','中华医学会','此次读片会供片单位为北京肿瘤医院。','1','2016-07-29 14:10:44','1','0000-00-00 00:00:00','0'),('2','山东临沂细胞读片库','临沂鲁商铂尔曼大酒店','2016-07-17 00:00:00','山东省细胞学组','为了促进细胞病理学技术的发展，提高细胞病理学技术质量和诊断水平，定于2016年7月在临沂举办《全国甲状腺针吸细胞学新进展学习班》。本次学习班以推广和研讨甲状腺针吸细胞学技术与诊断为重点，并对宫颈、乳腺、涎腺、尿、浆膜腔积液等其他细胞学领域进行授课和读片讨论。','1','2016-07-29 14:12:07','1','0000-00-00 00:00:00','0'),('3','九江市病理学会读片会','九江学院浔东校区华文楼5楼503','2015-07-22 00:00:00','九江市病理学会','','1','2016-07-29 14:13:05','1','0000-00-00 00:00:00','0'),('4','北京市第500次','东单三条甲7号','2016-07-22 00:00:00','中华医学会','此次读片会供片单位为煤炭总医院和北京安贞医院。','1','2016-07-29 14:13:38','1','0000-00-00 00:00:00','0'),('5','2015徐州读片会','','2015-07-22 00:00:00','','','1','2016-07-29 14:14:45','1','0000-00-00 00:00:00','0'),('6','2014读片会','','2014-07-22 00:00:00','','','1','2016-07-29 14:15:27','1','0000-00-00 00:00:00','0'),('7','2013读片会','广东','2013-07-22 00:00:00','','2013读片会','1','2016-07-29 15:16:04','1','2016-07-29 15:16:05','0'),('8','天津病理学术年会','天津','2016-07-22 00:00:00','天津医科大学，天津病理协会','此次读片会切片由天津医科大学总医院、天津医科大学肿瘤医院、天津医科大学第二附属医院及天津市人民医院提供。','1','2016-07-29 14:16:35','1','0000-00-00 00:00:00','0'),('9','江西神农宫','万年县人民医院','2016-07-22 00:00:00','上饶市卫生和计划生育委员会','此次读片会切片和病例由江西省多家医院提供。','1','2016-07-29 14:17:40','1','0000-00-00 00:00:00','0'),('cb4a7e13a68247bd9519635840052dd2','2012读片会','','2012-06-05 00:00:00','','','1','2016-07-29 17:30:24','1','2016-07-29 17:32:15','0');

