/*Table structure for table `t_scanner` */

DROP TABLE IF EXISTS `t_scanner`;

CREATE TABLE `t_scanner` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `company_id` varchar(64) NOT NULL COMMENT '子公司',
  `common_point` varchar(64) NOT NULL COMMENT '共建点',
  `scanner_code` varchar(64) NOT NULL COMMENT '扫描仪编码',
  `mosaic` char(1) NOT NULL DEFAULT '0' COMMENT '是否公网静态IP',
  `remarks` varchar(128) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_scanner` */

/*Table structure for table `t_slide` */

DROP TABLE IF EXISTS `t_slide`;

CREATE TABLE `t_slide` (
  `id` varchar(64) NOT NULL COMMENT '主键',
  `barcode` varchar(100) DEFAULT NULL COMMENT '条码',
  `label` longtext COMMENT '标签',
  `overview` longtext COMMENT '缩略图',
  `label_with_overview` longtext COMMENT '标签&缩略图',
  `url` varchar(500) DEFAULT NULL COMMENT '书签切片URL',
  `scanner_model` varchar(20) DEFAULT NULL COMMENT '扫描仪型号',
  `scanner_code` varchar(20) DEFAULT NULL,
  `create_date_time` timestamp NULL DEFAULT NULL COMMENT '数字切片创建时间',
  `physical_path` longtext COMMENT '文件绝对路径',
  `path` varchar(255) DEFAULT NULL COMMENT '用于url拼接',
  `token` varchar(64) DEFAULT NULL COMMENT '令牌',
  `point` varchar(64) DEFAULT NULL COMMENT '网点',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='数字切片';

